import React, { useState } from 'react';
import images from './images';
import './work.css';
import WorkGrid from './WorkGrid.js';

const Work = (props) => {
	const [slidesState, setNextSlide] = useState({
		firstSlide: [
			{ egypt: images.egypt[0] },
			{ greco: images.greco[0] },
			{ map: images.map[0] },
			{ news: images.news[0] },
			{ weather: images.weather[0] },
		],
	});
	const nextSlide = () => {
		setNextSlide({
			firstSlide: [
				{ egypt: images.egypt[0] },
				{ greco: images.greco[0] },
				{ map: images.map[0] },
				{ news: images.news[0] },
				{ weather: images.weather[0] },
			],
		});
	};
	return (
		<div className="work-div">
			<WorkGrid slidesState={slidesState} />
		</div>
	);
};

export default Work;
